import React, {useEffect, useState} from 'react';
import Dropdown from './dropdown';

function RateText() {

    const [notes, setNotes] = useState([{
        title: '',
        text: ''
    }])

    useEffect(() => {
        fetch("/rating").then(res => {
           if(res.ok) {
               return res.json()
           }
        }).then(jsonRes => setNotes(jsonRes));
    })

    return (
        <div className="container">
            <h1>Rate text</h1>
            <Dropdown />

            {notes.map(note =>
            <div> 
                <h1>{note.title}</h1>
                <p>{note.text}</p>
            </div>
            )}
        </div>
    )};

export default RateText;
